import { useState,useEffect } from "react"
import axios from "axios"
import Data from "./Data"

export default function TourList() {
    const [more, setMore] = useState("")
    useEffect(() => {
        const options = {
            method: 'GET',
            url: 'https://community-purgomalum.p.rapidapi.com/json',
            params: {},
            headers: { 
                'X-RapidAPI-Key': 'dc5706c317msh3beb5e61385dfa1p12c4bajsn68f2a3e1a6c6',
                'X-RapidAPI-Host': 'community-purgomalum.p.rapidapi.com'
            }
        }

        axios.request(options).then(response => {
            console.log(response.data);
        }).catch(error => {
            console.error(error);
        })
    }, [])
    const showMore = () => {
        setMore()
    }
    return(
        <div className="container d-flex justify-content-center mt-4">
            <div>
            { Data.map((place) => (
                <div className="card shadow mt-3">
                    <div className="card-head">
                        <img src={place.image} />
                    </div>
                    <div className="card-body">
                        <div className="d-flex justify-content-between mt-3">
                            <h5>{place.comment}</h5>
                            <h5 className="text-info">{'$' + place.price}</h5>
                        </div>
                        <p style={{color:'#617d98'}}>{place.about}<button value={more} onClick={showMore} style={{color:'blue'}}>read more</button></p>
                    </div>
                </div>
            ))}
            </div>
        </div>
    )
}
